import React, { Component } from 'react';
import './App.css';

export default class Home extends Component {
    componentDidMount() {
        var data = fetch('/').then(data => data.json())
    }

    render() {
        return (
            <div>
                <h1>Home Page</h1>
            </div>
        );
    }
}
